const mongoose = require('mongoose')

const schema = new mongoose.Schema({
     username :{
        type : String ,
        require : true ,
        unique : true 
     } ,
     password :{
        type : String ,
        require : true ,
        unique : true ,
     } ,
     Email :{
        type : String ,
        require : true ,
        unique : true ,
     } ,

     Profile : {
      type : String ,
      default : "data:image/jpeg;base64,",
     } ,

     Date :{
      type : Date ,
      default : Date.now , 
     } ,
     Aboutme : {
      type : String ,
      default : "" ,
     } 

})

module.exports = new mongoose.model('userdata' , schema)